from d3tales_api.Processors.d3tales_parser import *
from robotics_api.workflows.standard_variables import *


def cv_meta_calcs(multi_data, num_electrons=DEFAULT_NUM_ELECTRONS, curve_type="anodic"):
    processed_data = []
    for i in multi_data:
        try:
            data_dict = i.get('data')
            data_dict["n"] = num_electrons
            data_dict["current_cathodic"] = data_dict.get("forward", {})[num_electrons - 1][1]
            data_dict["current_anodic"] = data_dict.get("reverse", {})[num_electrons - 1][1]
            processed_data.append(data_dict)
        except:
            pass
    connector = {
        "n": "n",
        "i_p": "current_{}".format(curve_type),
        "X": "peak_splittings.{}".format(num_electrons - 1),
        "v": "conditions.scan_rate",
        "T": "conditions.temperature",
        "C": "conditions.redox_mol_concentration",
        "A": "conditions.working_electrode_surface_area",

        "D": "diffusion",
        # "scan_data": "scan_data",
    }

    try:
        # Calculate diffusion constant
        diffusion_cal = CVDiffusionCalculator(connector=connector)
        diffusion_coef = diffusion_cal.calculate(processed_data, sci_notation=True)

        # Calculate charge transfer rates
        [d.update({"diffusion": float(diffusion_coef[1])}) for d in processed_data]
        transfer_cal = CVChargeTransferCalculator(connector=connector)
        transfer_rate = transfer_cal.calculate(processed_data, sci_notation=True)
        return diffusion_coef, transfer_rate
    except:
        return [None, None], None


def all_cvs_data(multi_data, num_electrons=1):
    connector = {
        "A": "data.conditions.working_electrode_surface_area",
        "v": "data.conditions.scan_rate",
        "C": "data.conditions.redox_mol_concentration",
        "n": "num_electrons",
        "scan_data": "data.scan_data"
    }

    single_cvs = []
    for i, i_data in enumerate(multi_data):
        single_cvs.append("\n---------- CV {} ----------".format(i + 1))
        i_data["num_electrons"] = num_electrons
        [single_cvs.append("{}: \t{}".format(prop, i_data.get("data", {}).get(prop))) for prop in i_data.get("data", {}).keys()]
        for prop in ['e_half', 'middle_sweep', 'peak_splittings', 'peaks', 'reversibility']:
            try:
                value = getattr(CVDescriptorCalculator(connector=connector), prop)(i_data)
                single_cvs.append("{}: \t{}".format(prop, value))
            except:
                pass
    return single_cvs


def print_cv_analysis(multi_data, num_electrons=DEFAULT_NUM_ELECTRONS):
    out_txt = ""

    out_txt += "\n------------- Single CVs Analysis -------------\n"
    out_txt += '\n'.join(all_cvs_data(multi_data, num_electrons=num_electrons))

    diffusion_coef, transfer_rate = cv_meta_calcs(multi_data, num_electrons=num_electrons, curve_type="anodic")
    out_txt += "\n\n------------- Anodic -------------\n"
    out_txt += "Diffusion Coefficient (Randles-Sevcik): \t{}\n".format(diffusion_coef[0])
    out_txt += "Diffusion Coefficient (mean method): \t{}\n".format(diffusion_coef[1])
    out_txt += "Charge Transfer Rate: \t\t\t{}\n".format(transfer_rate)

    diffusion_coef, transfer_rate = cv_meta_calcs(multi_data, num_electrons=1, curve_type="cathodic")
    out_txt += "\n------------- Cathodic -------------\n"
    out_txt += "Diffusion Coefficient (Randles-Sevcik): \t{}\n".format(diffusion_coef[0])
    out_txt += "Diffusion Coefficient (mean method): \t{}\n".format(diffusion_coef[1])
    out_txt += "Charge Transfer Rate: \t\t\t\t{}\n".format(transfer_rate)

    return str(out_txt)


